import React from 'react';
import { useState } from 'react';

const EditElectrodeOne = () => {

const [changeStyle1, setChangeStyle1] = useState(false);



    return (
        <div>
            <ul className='editElectrodeBox'>
                <li className='electrodeBoxItem' id='elementOne'>Magnesium</li>
                <li className='electrodeBoxItem' id='2'>Strontium</li>
                <li className='electrodeBoxItem' id='3'>Flurorine</li>
                <li className='electrodeBoxItem' id='4'>Iron<sup>3+</sup></li>
                <li className='electrodeBoxItem' id='5'>Hydrogen</li>
                <li className='electrodeBoxItem' id='6'>Iron<sup>2+</sup></li>
                <li className='electrodeBoxItem' id='7'>Sodium</li>
                <li className='electrodeBoxItem' id='8'>Calcium</li>
                <li className='electrodeBoxItem' id='9'>Lithium</li>
                <li className='electrodeBoxItem' id='10'>Nickel</li>
            </ul>
            <button className='button-75'>Submit Electrode 1</button>
        </div>
    )
}

export default EditElectrodeOne
